import {GlobalStyleSheet} from '../../../global-styles/styleSheet';

const primry_color = GlobalStyleSheet.primry_color;
const primary_text_color = GlobalStyleSheet.primary_text_color;

export const ToolbarStyleSheet = {
    background: {
        background: `${primry_color}`,
    },
    brand: {
        color: `${primry_color}`,
        fontSize: 'larger',
        fontWeight: 'bolder'
    },
    form: {
        border: `2px solid ${primry_color}`,
        width: '60%',
        borderRadius: '25px',
        padding: '0px 5px'
    }
}
